import React from 'react';

import './index.css';

export default function EditButtons({onEdit, onDelete, onNavigate}) {
  return (
    <>
    <button
      style={{
        position: "absolute",
        top: "10px",
        right: "60px",
        border: "none",
        zIndex: 1,
      }}
      type="button"
      className="btn btn-outline-dark"
      onClick={onEdit}
    >
      <i className="bi bi-pencil-fill"></i>
    </button>
    <button
      style={{
        position: "absolute",
        top: "10px",
        right: "40px",
        border: "none",
        zIndex: 1,
      }}
      type="button"
      className=" btn btn-outline-dark"
      onClick={onDelete}
    >
      <i className="bi bi-trash-fill"></i>
    </button>
    <button
      style={{
        position: "absolute",
        top: "10px",
        right: "20px",
        border: "none",
        zIndex: 1,
      }}
      type="button"
      className='pos btn btn-outline-dark'
      onClick={onNavigate}
    >
      <i className='bi bi-arrows-fullscreen'></i>
    </button>
  </>
  )
}
